import React from 'react';

const Navbar = () => (
    <nav className="navbar navbar-dark bg-info mb-10 mt-5">
        <div className="container">
            <a href="/#" className="navbar-brand">Github Finder</a>
        </div>
    </nav>
);

export default Navbar;
